2) Continue with counseling presently in;
3) Maintain full-time employment/schooling combination;
4) Submit to random urine screens and pay for same;
5) On Count 1 pay $100.00 fine, plus costs; 
6) Pay supervision fees in an amount to be determined by DOC.
